package operator;

public class Operator5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//관계(비교)연산자
		
		int a = 10;
		int b = 20;
		
		System.out.println(a>b);
		System.out.println(a<=b);
		System.out.println(a==b);
		System.out.println(a!=b);
		
		
		int c = 30;
		int d = 40;
		double e = 30.14;
		double f = 50.14;
		
		System.out.println(a<b);
		System.out.println(a>b);
		System.out.println(a+b<=c);
		System.out.println(c+d>=f);
		System.out.println(e==f);
	}

}
